import { memo } from 'react';

const Ellipse4Icon = (props) => (
  <svg preserveAspectRatio="none" viewBox="0 0 12 13" fill="none" xmlns="http://www.w3.org/2000/svg" {...props}>
    <circle cx={6} cy={6.5} r={6} fill="white" stroke="#FB7D5B" strokeWidth={3} />
  </svg>
);

const MemoEllipse4Icon = memo(Ellipse4Icon);
export { MemoEllipse4Icon as Ellipse4Icon };
